    <>
    <div className="App">
    <h1> {isUserLogin?(<><h1>welcome to the user dashboard</h1></>):(<><h1>no name</h1></>)}</h1>

    </div>
    {/* <MyRouter/> */}
    </>
  );
}

export default App;
